import ReactDOM from 'react-dom'
import { UserSignUp } from '../../services/authentication/authentication'

const SignUp = () => {

    console.log('enter sign up')

    let username;
    let email;
    let password;
    let rePassword;

    const handleUsernameChange = event => {
        username = event.target.value
        console.log(username)
    }

    const handleEmailChange = event => {
        email = event.target.value
    }

    const handlePasswordChange = event => {
        password = event.target.value
    }

    const handleRePasswordChange = event => {
        rePassword = event.target.value
    }

    const handleSubmit = () => {
        console.log('********')
        if (password === rePassword) {
            const data = {
                username: username,
                email: email,
                password: password
            }
            console.log('__________')
            UserSignUp(data).then((response) => {
                if (response.status === "error") {
                    console.log('error')
                }
                else {
                    console.log('success')
                }
            })
                .catch((error) => {
                    console.log(error)
                })
        }
    }

    let content = (
        <div>
            <h3>Sign up</h3>
            <div>
                <form action="">
                    <label>Username</label>
                    <input type="text" onChange={handleUsernameChange} name="username" />
                    <label>Email</label>
                    <input type="text" onChange={handleEmailChange} name="email" />
                    <label>Password</label>
                    <input type="password" onChange={handlePasswordChange} name="password" />
                    <label>Retype password</label>
                    <input type="password" onChange={handleRePasswordChange} name="repassword" />
                    <input type="submit" value="Sign up" onClick={() => handleSubmit()} />
                </form>
            </div>
        </div>
    );
    return content;
}

export default SignUp
